import React from "react";

import styles from "./ResultList.module.css";

//Tạo component hiển thị danh sách các kết quả của việc tìm kiếm
const ResultList = () => {
  return (
    <div>
      <p className={styles.searchresult}>Search Result</p>
    </div>
  );
};

export default ResultList;
